Description:
Location Location - Live in OR High Yield - Low Maintenance
Located in a quiet cul-de-sac and surrounded by a new development, this home presents a smart choice for an astute home owner or investor.
This one-bedroom unit presents great value in a highly sought after area in Dandenong. The quite location and close proximity to Dandenong train station and public transport makes this home a must see.
You will find this lovely presented home has many features, including:
- Updated kitchen and bathroom;
- Secure and enclosed court yard or entertainment area;
- Reverse cycle heating and cooling;
- Large bedroom with large robe.
This home is located close to Dandenong train station and Dandenong shopping centre together with many other local amenities.
